void Randoms::LoadRandomDotOrg( const char *filename ) {
 OUTPUT("Randoms: Loading and randomifying '%s' from Random.org\n",filename);
 Random *random=new Random;
 Append(random);
 {
  // Open
  BinaryFile *binary_file=new BinaryFile(filename,false);
  // Read into bytes randoms
  binary_file->read(1000000,&(random->randoms));
  delete binary_file;
 }
 // Generate unsigned, float and integer versions by factor of 4 passing through integer
 // We do not convert to double because it will never be that precise (limited to ~10 decimal precision)
 for ( int f=0; f<250000; f++ ) {
  unsigned int converted=((random->randoms.list[f]<<24)
                         |(random->randoms.list[f+1]<<16)
                         |(random->randoms.list[f+2]<<8)
                         |(random->randoms.list[f+3]));
  random->randomsui[f]=converted;
  random->randomsi[f]=(int)((long)converted-(long)INT_MAX/(long)2);
  random->randomsf[f]=(float)((double)((long double)converted/(long double)INT_MAX)/2.0);
 }
 // Generate the values of 3.6M (approx) rand() calls indexed by seeds determined by the file.
 int filename_as_seed=0;
 size_t len=strlen(filename);
 for ( int i=0; i<(int)len && filename[0]!='\0'; i++ ) filename_as_seed+=(int)filename[i];
 filename_as_seed+=(int)len;
 for ( int i=0; i<100; i++ ) {
  for ( int j=0; j<PSEUDORAND_MAX; j++ ) {
   random->rands[i].rands[j]=
    (unsigned short) pseudorandom(
     filename_as_seed+i+(int)random->randoms[i],
     j+(int)random->randoms[j])
    % PSEUDORAND_MAX;
  }
 }
 // Resequence values in a series
 Indexed<Zbool> sequenced;
 for ( int f=0;  f<100000; f++ ) {
  double value=(double)f/100000.0;
  int searches=0;
  int place=f+1;
  int index=(int)abs((double)random->randomsf[place]*100000.0);
  if ( place%2==1 ) {
   while ( sequenced[index] && searches< 10000 ) {
    index+=(unsigned short)random->rands[index%100].rands[index%PSEUDORAND_MAX];
    if ( index < 0 || index >= 100000 ) index=0;
    searches++;
   }
  } else {
   while ( sequenced[index] && searches< 10000 ) {
    index-=(unsigned short)random->rands[index%100].rands[index%PSEUDORAND_MAX];
    if ( index < 0 || index >= 100000 ) index=100000;
    searches++;
   }
  }
  if ( searches >= 10000 ) {
   place%=PSEUDORAND_MAX;
   if ( place%2==1 ) {
    index=random->rands[f%100].rands[place];
    while ( sequenced[index] ) {
     index++;
     if ( index < 0 || index >= 100000 ) index=0;
     index%=100000;
    }
   } else {
    index=100000-random->rands[f%100].rands[place];
    while ( sequenced[index] ) {
     index--;
     if ( index < 0 || index >= 100000 ) index=100000-1;
     index%=100000;
    }
   }
  }
  random->resequenced[index]=(float)value;
  sequenced[index]=true;
 }
}

#include "BinaryFile.h"

void Randoms::LoadRandom( const char *filename ) {
 if ( !file_exists(filename) ) {
  OUTPUT("Randoms::LoadRandom() file `%s` does not exist or cannot be read.\n", filename );
  return;
 }
 Random *set=new struct Random;
 BinaryFile *file=new BinaryFile(filename,false);
 file->Fread( 1000000, set->randoms.list, sizeof(byte) );
 file->Fread( 250000,  set->randomsui.list, sizeof(unsigned int) );
 file->Fread( 250000,  set->randomsi.list   , sizeof(int) );
 file->Fread( 250000,  set->randomsf.list   , sizeof(float) );
 file->Fread( 100000,  set->resequenced.list, sizeof(float) );
 for ( int i=0; i<100; i++ ) file->Fread( PSEUDORAND_MAX, set->rands[i].rands.list, sizeof(unsigned short) );
 Append(set);
 delete file;
}

/*
 * This function takes a seed value and juggles it to randomize it between l and h. 
 * H-L cannot equal 0
 * Coco-de-mer, the world's largest seeds
 */
int COCO_DE_MER=INT_MAX;
int randomify( int seed, int l, int h ) { 
 int d=h-l;
 float p= (float) (seed % (d == 0 ? 1 : d)) / (float) (d == 0 ? 1 : d);
 //OUTPUT("Maximum integer value is: %d\n", COCO_DE_MER );
 //printf( "%d", MAXINT );
 return ilerp(l,h,p);
}

float randomify2( int seed, int max ) {
 if ( seed<0 ) seed=abs(seed);
 while ( seed > max ) seed-=max/4;
 return (float) seed / (float) max;
}

int randify( int seed, int max ) {
 return (int) (xyzs[seed%60000]*float(max));
}

float randify( int seed, float max ) {
 return (xyzs[seed%60000]*(max));
}

// Used to do conversion / expansion
void Randoms::SaveRandom( const char *filename, Random *set ) {
 BinaryFile *file;
 file=new BinaryFile(filename,true);
 file->write(&set->randoms);
 file->write(&set->randomsi);
 file->write(&set->randomsui);
 file->write(&set->randomsf);
 file->write(&set->resequenced);
 for ( int i=0; i<100; i++ ) file->write(&set->rands[i].rands);
 delete file;
}

